How to detect field name typo when saving a Mongoose Schema?<p>I made a typo in a Mongoose Schema and the field in the POST request did not match that in the database. So Mongoose did not save that field in the document.</p>
<p>The form had this field (in PUG):</p>
<pre><code>input(type=&quot;checkbox&quot; id=&quot;happiness&quot;, name=&quot;happiness&quot;, value=&quot;true&quot;)
label(for=&quot;happiness&quot;) feels happier
</code></pre>
<p>The Mongoose Schema was missing an <code>s</code> in that field:</p>
<pre><code>'use strict';

const mongoose = require('mongoose');
const Schema = mongoose.Schema;

// Use native promises.
mongoose.Promise = global.Promise;

// Define the schema.
const QuestionnaireSchema = new Schema({

  happines: Boolean,
  // ...
}
</code></pre>
<p>So the field <code>happiness</code> in <code>req.body</code> was discarded without a warning.</p>
<p>How can I ensure that every field in the <code>req.body</code> object be present in the Mongoose schema?</p>

