How to remove these embedded documents from MongoDb?<p>I have a field which is a dictionary of embedded documents (I hope my terminology is right). I'm trying to remove all embedded documents (from this dictionary) where the key is NOT <code>abc</code>.</p>
<p>This mongo script works great:</p>
<pre><code>db.getCollection(&quot;users&quot;).update(
    {},
    {
        $unset: 
        { 
            &quot;prefs.state.AAAA&quot;: &quot;&quot;,
            &quot;prefs.state.BBBB&quot;: &quot;&quot;,
            &quot;prefs.state.CCCC&quot;: &quot;&quot;,
        } 
    },
    {
        multi: true
    }
);
</code></pre>
<p>My problem here is that I actually don't know all the possible key's, in this dictionary list.</p>
<p>In the above example, i have</p>
<ul>
<li>AAAA</li>
<li>BBBB</li>
<li>CCCC</li>
</ul>
<p>but i could have a heap more.</p>
<p>here's an example legit document:</p>
<pre><code>{ 
    &quot;_id&quot; : 1.0, 
    &quot;prefs&quot; : {
        &quot;state&quot; : {
            &quot;abc123&quot; : { // TO STAY
                &quot;name&quot; : &quot;name1&quot;, 
                &quot;age&quot; : 1.0
            }, 
            &quot;AAAA&quot; : { // TO BE REMOVED
                &quot;name&quot; : &quot;name2&quot;, 
                &quot;age&quot; : 2.0
            }, 
            &quot;XASDASD&quot; : { // TO BE REMOVED
                &quot;name&quot; : &quot;name3&quot;, 
                &quot;age&quot; : 3.0
            }
        }
    }
}
{ 
    &quot;_id&quot; : 2.0, 
    &quot;prefs&quot; : {
        &quot;state&quot; : {} // NO DATA, but this is OK
    }
}
{ 
    &quot;_id&quot; : 3.0, 
    &quot;prefs&quot; : {
        &quot;state&quot; : {
            &quot;CCCC&quot; : { // TO BE REMOVED
                &quot;name&quot; : &quot;name4&quot;, 
                &quot;age&quot; : 4.0
            }
        }
    }
}

</code></pre>
<p>So what i'm trying to do is this:</p>
<p>If <code>prefs.state.&lt;KEY&gt;</code> doesn't equal <code>abc123</code> then this embedded document should be nuked.</p>
<p>So given the mongo script above, it will find <code>prefs.state.AAAA</code> and unset that field, which bascially nukes that embedded doc.</p>
<p>Is this possible?</p>
<hr />
<p>Update 1: here's the shell output (which shows it fails). I ran this in the app &quot;Studio 3T&quot;</p>
<p>Script:</p>
<pre><code>db = db.getSiblingDB(&quot;users&quot;);


db.getCollection(&quot;jussytest&quot;).updateMany(
    {},
    [
        {
            $set: {
                &quot;prefs.state&quot;: {
                    $arrayToObject: {
                        $filter: {
                            input: { $objectToArray: &quot;$prefs.state&quot; },
                            as: &quot;x&quot;,
                            cond: { $eq: [&quot;$$x.k&quot;, &quot;abc123&quot;] }
                        }
                    }
                }
            }
        }
    ]);

 db.getCollection(&quot;jussytest&quot;).find({});

</code></pre>
<p>Result:</p>
<pre><code>MongoDB shell version v4.0.16
connecting to: mongodb://localhost:27017/users
Implicit session: session { &quot;id&quot; : UUID(&quot;1ae46c5b-a711-4f56-adb4-5e5f8a093750&quot;) }
