Mongodb $lookup aggregation returns all documents from foreign index<p>I have a users index</p>
<pre><code>[{
 username: &quot;foo@bar,
 roleIds: [ Types.ObjectId(&quot;1234&quot;) ]
},
{
 username: &quot;foo@moo,
}]
</code></pre>
<p>With a <code>roles</code></p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;60465768f768621ec5828b68&quot;),
    &quot;name&quot; : &quot;admin&quot;,
    &quot;permissionIds&quot; : ObjectId(&quot;604657e8e715ss1f2d78b945&quot;)
}
</code></pre>
<p>and <code>permissions</code></p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;604657e8e715ss1f2d78b945&quot;),
    &quot;name&quot; : &quot;view-user&quot;,
}
</code></pre>
<p>When I get the user by username, I want to hydrate the role information. <strong>Not all users have roleIds</strong> so I need to be able to still return the user regardless of whether they have roleIds.</p>
<p>At the moment the lookup for the roles always returns every item in the <code>roles</code> index!</p>
<p>My idea is that I lookup the <code>roles</code> joining on the index <code>roles</code> by the array <code>roleIds</code> to <code>_ids</code></p>
<p>Then I pipeline within that lookup to grab the permission information from within the role.</p>
<pre><code>db.getCollection('users').aggregate([
        {
          $match: {
            'username':'foo@bar',
          }
      },
        {
          $lookup: {
            from: 'roles',
            let: {'roleIds': '_id'},
            as: 'roles',
            pipeline: [{
                $lookup: {
                  from: 'permissions',
                  let: {'permissionIds': &quot;_id&quot;},
                  as: 'permissions',
                  pipeline: [
                    {
                      $project: {
                        name: 1
                      }
                    }
                  ]
                }
              },{
                $project: {
                  name: 1,
                  permissions: 1
                }
              }
            ]
          }
        }
